  const [name, onChangeName] = useInput();
  const [price, onChangePrice] = useInput();

  return (
    <Form encType={"multipartForm"}>
      <Input></Input>
      <ImageInput />
      <Button type="primary" htmlType="submit">
        제출
      </Button>
    </Form>
  );
};

